  this.port = builder.port;
  this.protocol = builder.protocol;
  this.queryParameters = builder.queryParameters || {};
  this.bodyParameters = builder.bodyParameters || {};
  this.headers = builder.headers || {};
  this.path = builder.path || '';
}

