Request.prototype.getQueryParameterString = function () {
  const uri = new URI();
  uri.search(this.getQueryParameters());
  return uri.href();
};

Request.prototype.getURI = function () {
  const uri = new URI({
    protocol: this.protocol,
    hostname: this.hostname,
    path: this.path,
  });
